    useEffect(()=>{
        async function getData(){
            try {
              const data = await axios.get("http://localhost:8000/getcoures")
              console.log(data);
             setCourses(data.data)
        
            } catch (error) {
              console.log(error);
            }
        }
        getData()
    },[])
return(
    <Card/>
)
}
